import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <div>
      {/* Top Logo Section */}
      <div className="d-flex justify-content-center align-items-center py-2" style={{ backgroundColor: '#ffe600' }}>
        <span
          className="fw-bold fs-3 px-4 py-2 border border-dark rounded"
          style={{
            letterSpacing: '3px',
            fontFamily: 'monospace',
            color: '#1a1a1a',
            backgroundColor: '#ffffff',
          }}
        >
          MEEWOO
        </span>
      </div>

      {/* Bottom Navigation Section */}
      <nav className="navbar bg-primary px-3" data-bs-theme="dark">
        <div className="container-fluid d-flex justify-content-end align-items-center">
          <div className="d-flex gap-2">
            <Link to="/" className="btn btn-outline-light">Home</Link>
            <Link to="/features" className="btn btn-outline-light">Features</Link>
            <Link to="/pricing" className="btn btn-outline-light">Pricing</Link>
          </div>
        </div>
      </nav>
    </div>
  );
}

export default Navbar;
